var words;



export default class Home extends Component {

componentDidMount(){
  console.log("working");
    Tesseract
    .recognize(logo)
    .then(function(result){
      console.log(result);
      wordsbool=true;
      words=result.text;
      console.log({wordsbool})
      console.log({words})
      this.forceUpdate();
    })

}

        render() {
         if(wordsbool===false){
           return(
             <div className="homebox">Loading...</div>

