          wait={1000}>
           <div>hi</div>
         <div>hi</div>
         <div>hi</div>
         <div>hi</div>
         <div>result:</div>
         <div>{words}</div>
         <div>hi</div>
         </Delay>



       </div>
          )
        }

      }


}
